@Menodiunminuto non potremo mai avere un riscontro,
personalmente ritenevo talmente suicida andare al voto da ritenere che un politico navigato come Zingaretti non lo contemplasse e che la mossa l'abbia forse costretto ad una trattativa di governo in salita.
Però tornando alla tua domanda è Si

«Suppongo che il suicida mentre appoggia alla tempia la canna della pistola provi per ciò che succederà l'attimo seguente quello che in quel momento provai io: un sentimento di curiosità» 
@Einaudieditore #HerbertGWells #booklandia
